import React from 'react'
import { items } from '../items'
import '../styles/card.css'


function Card(props) {
    return (
        <div className='bckg'>
            <div className='card-container'>
                <h1 className='h1'>{this.props.items.title}</h1>
            </div>
        </div>
    )
}

export default Card
